column8:
物置を設置する場合に一番大切なのは地面に傾斜が無いことが重要です。<br />
物置などの工業製品は地面が水平で無い場所で設置するとビス穴や扉などがうまく合わなくなり設置ができない、鍵が閉まらないなどの問題が発生します。<br />
土の場合、簡単に削ることができ傾斜を水平にすることができるのですが<br />
コンクリートやアスファルトなど土と違って安易に傾斜を調整できない場合は、モルタル（セメントと水と砂を合わせたもの）をブロックの下に敷き調整をします。<br />
調整できる高さは3センチくらいです。それ以上の場合はブロックなどの高さも変えてモルタルで調整しますので一度ご相談ください。<!--左追いかけバナー セール用-->

<!--　セール左追いかけバナー　ここまで　-->

<style type="text/css">
input[value="買い物かごに入れる"]{

	font-size:16px;
	font-family: "メイリオ","Meiryo"; 
	font-weight:bold;
	-moz-border-radius:8px;
	-webkit-border-radius:8px;
	border-radius:8px;
	border:1px solid #d83526;
	padding:9px 18px;
	text-decoration:none;

	background:-moz-linear-gradient( center top, #fe1a00 5%, #ce0100 100% );
	background:-ms-linear-gradient( top, #fe1a00 5%, #ce0100 100% );
       	background:-webkit-gradient( linear, left top, left bottom, color-stop(5%, #fe1a00), color-stop(100%, #ce0100) );

	background-color:#fe1a00;
	color:#ffffff;
	display:inline-block;
	text-shadow:1px 1px 0px #b23e35;
 	box-shadow:inset 1px 1px 0px 0px #f29c93; } 
</style>

<style type="text/css">
input[value="現地調査依頼"]{

	font-size:16px;
	font-family: "メイリオ","Meiryo"; 
	font-weight:bold;
	-moz-border-radius:8px;
	-webkit-border-radius:8px;
	border-radius:8px;
	border:1px solid #d83526;
	padding:9px 18px;
	text-decoration:none;

	background:-moz-linear-gradient( center top, #fe1a00 5%, #ce0100 100% );
	background:-ms-linear-gradient( top, #fe1a00 5%, #ce0100 100% );
       	background:-webkit-gradient( linear, left top, left bottom, color-stop(5%, #fe1a00), color-stop(100%, #ce0100) );

	background-color:#fe1a00;
	color:#ffffff;
	display:inline-block;
